- model: communitymanager.post
  pk: 1
  fields:
    titre: NGAD Program
    description: The NGAD program is a sixth generation fighter currently in development
      by the US Air Force, it is expected to enter service after 2030 and will replace
      the F-22 in frontline service. Very few information is available, but it is
      expected that it will be stealthier with long range, advanced weapons and variable
      cycle engines
    date_creation: 2021-05-25 09:31:54+00:00
    community: 1
    priorite: 1
    evenementiel: false
    date_evenement: 2021-05-25
    auteur: 2
- model: communitymanager.post
  pk: 2
  fields:
    titre: Tempest FCAS
    description: The Tempest FCAS is a sixth-generation fighter in development by
      BAE Systems in partnership with Alenia and Saab, it is expected to serve as
      a replacement for the UK's and Italy's Eurofighter Typhoon, and maybe also Sweden's
      Gripen
    date_creation: 2021-05-25 09:39:16+00:00
    community: 2
    priorite: 1
    evenementiel: false
    date_evenement: 2021-05-25
    auteur: 3
- model: communitymanager.post
  pk: 3
  fields:
    titre: NGF Program
    description: The New Generation Fighter is a sixth-generation multirole fighter
      in development by France's Dassault Aviation and Germany's Airbus Defence and
      Space in partnership with Safran, MTU, Thales, Indra and MBDA. It will replace
      French Rafales, German and Spanish Typhoons from 2040.
    date_creation: 2021-05-25 09:44:27+00:00
    community: 3
    priorite: 1
    evenementiel: false
